import axios from 'axios';
import React, {useState, useEffect} from 'react';
import { useParams, useHistory } from 'react-router';
import { Link } from 'react-router-dom';

const BiosampleDetail = () => {

const [Datas, setDatas] = useState([])

const {id} = useParams();
const history = useHistory();

useEffect(() => {
    getSingleDatas();
},[])


const getSingleDatas = async () => {
  const  { data } = await axios.get(`http://127.0.0.1:8000/api/biosample/${id}/`)
  console.log(data);
  setDatas(data);


}

const deleteUser = async (id) => {
    await axios.delete(`http://127.0.0.1:8000/api/biosample/${id}/`)
    history.push("/")
}



    return (
        <div>
            <h2>Detail of Single Datass </h2>
            <hr></hr>
            <div className="full-Datas-detail">

                <div className="Datas-detail">
                    <p>{Datas.biosample_id}</p>
                    <p>{Datas.biosample_type}</p>
                    <p>{Datas.biosample_name}</p>
                    <p>{Datas.biosample_path}</p>
                    <p>{Datas.library_id}</p>
                    <p>{Datas.biosample_created_on}</p>
                    <p>{Datas.project_id}</p>
                </div> 
            </div>




            <Link className="btn btn-outline-primary mr-2" to={`/${Datas.id}/update`}>Update</Link>
            <Link className="btn btn-danger" onClick={() => deleteUser(Datas.id)}>Delete</Link>
        </div>
    );
};

export default BiosampleDetail;
